import React from 'react';
import logo from './42_Logo.svg.png';
import FC from './FC.png';
import './App.css';
import { Avatar, Box, Button, Container } from '@mui/material';
import { Helmet } from 'react-helmet';


const images = [
  {
    url: '/static/images/buttons/breakfast.jpg',
    title: 'Breakfast',
    width: '40%',
  },
  {
    url: '/static/images/buttons/burgers.jpg',
    title: 'Burgers',
    width: '30%',
  },
  {
    url: '/static/images/buttons/camera.jpg',
    title: 'Camera',
    width: '30%',
  },
];

const ImageButton = styled(ButtonBase)(({ theme }) => ({
  position: 'relative',
  height: 200,
  [theme.breakpoints.down('sm')]: {
    width: '100% !important', // Overrides inline-style
    height: 100,
  },
  '&:hover, &.Mui-focusVisible': {
    zIndex: 1,
    '& .MuiImageBackdrop-root': {
      opacity: 0.15,
    },
    '& .MuiImageMarked-root': {
      opacity: 0,
    },
    '& .MuiTypography-root': {
      border: '4px solid currentColor',
    },
  },
}));

const ImageSrc = styled('span')({
  position: 'absolute',
  left: 0,
  right: 0,
  top: 0,
  bottom: 0,
  backgroundSize: 'cover',
  backgroundPosition: 'center 40%',
});

const Image = styled('span')(({ theme }) => ({
  position: 'absolute',
  left: 0,
  right: 0,
  top: 0,
  bottom: 0,
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'center',
  color: theme.palette.common.white,
}));

const ImageBackdrop = styled('span')(({ theme }) => ({
  position: 'absolute',
  left: 0,
  right: 0,
  top: 0,
  bottom: 0,
  backgroundColor: theme.palette.common.black,
  opacity: 0.4,
  transition: theme.transitions.create('opacity'),
}));

const ImageMarked = styled('span')(({ theme }) => ({
  height: 3,
  width: 18,
  backgroundColor: theme.palette.common.white,
  position: 'absolute',
  bottom: -2,
  left: 'calc(50% - 9px)',
  transition: theme.transitions.create('opacity'),
}));

function App() {
  return (
    <div className="App">
      <Helmet>
        <style>{'body { background-color: black; }'}</style>
      </Helmet>
      <Box mt={42}>
        <Button variant="contained" sx={{ fontWeight: 'bold',fontSize: 'h8.fontSize' }} style={{backgroundColor:'#424242'}} 
          startIcon={<Avatar variant="square" src={logo}/>}
          target="_blank"
          component="a"
          // href="http://ssh.billyboy.fr:3000/api/auth/login">
          href="http://68.183.43.160:3000/profil">
          Connect
        </Button>
      </Box>
        <Button variant="contained" sx={{ fontWeight: 'bold',fontSize: 'h8.fontSize' }} style={{backgroundColor:'#424242'}} 
          startIcon={<Avatar variant="square" src={FC}/>}
          target="_blank"
          component="a"
          // href="http://ssh.billyboy.fr:3000/api/auth/login">
          href="http://68.183.43.160:3000/profil">
          Connect
        </Button>
        <ImageButton>

        </ImageButton>
    </div>
  );
}

export default App;
